title: A65 heading up past Macdonaldtown toward Central
date: 2025-04-24T12:37:00+10:00
detail: >-
  A yellow and silver double-decker suburban train labelled "A65" on the third
  track from the left out of six tracks. Above its windshield, the electronic 
  destination board reads "Central". Lots of overhead wiring and steel gantries
  are visible toward the top of the frame. In the background, some brick buildings
  can be seen. The sky is overcast being an even white colour.
